// export default Dashboard

import React, { Component } from "react";
import Slider from "react-slick";

export default class AutoPlay extends Component {
  render() {
    const settings = {
      infinite: true,
      slidesToShow: 3,
      slidesToScroll: 1,
      autoplay: true,
      speed: 3000,
      autoplaySpeed: 3000,
      cssEase: "linear"
    };
    return (
      <div className="container">
        <h2>Auto Play</h2>
        <Slider {...settings}>
          <div>
            <h1 style={{fontSize: 100, textAlign: "center"}}>1</h1>
          </div>
          <div>
            <h1>2</h1>
          </div>
          <div>
            <h1>3</h1>
          </div>
          <div>
            <h1>4</h1>
          </div>
          <div>
            <h1>5</h1>
          </div>
          <div>
            <h1>6</h1>
          </div>
        </Slider>
      </div>
    );
  }
}
